               <Avatar src={avatar}> 
               </Avatar>
            </PostContainer>
        
    );
};
const PostContainer =styled.div`
    display: flex;
    align-items: center;
`
const Avatar =styled.img`
    margin-right: 300px;
    width: px;
    height:5px;
    border-radius:2px;
`

    


export default Post;
